import { useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();
  function logOut() {
    localStorage.removeItem("@token");
    localStorage.removeItem("@id");
    navigate("/login", { replace: true });
  }

  return (
    <>
      <h1>eu sou a home</h1>
      <button>Sair</button>
    </>
  );
};

export default Home;
